import React from "react";
import {

  Headc,
 
} from "./Webdevelopment.element";
import {
  Headings,
  Longdescription,
  Shortdescription,
} from "../Aboutus/Aboutus.elements";
import { office } from "../../images/pexels-christina-morillo-1181355.jpg";
function Component_services_types(props) {
  return (
    <TwoRowGrid>
      <Headc>
      {props.head}
      </Headc>
      <Description>
      {props.description}
      </Description>
    </TwoRowGrid>
  );
}

export default Component_services_types;
